import path from 'path';
import { fileURLToPath } from 'url';

// Define __dirname for ES Modules
const __filename = fileURLToPath(import.meta.url);
const __dirname = path.dirname(__filename);

/** @type {import('next').NextConfig} */
const nextConfig = {
  async redirects() {
    return [
      { source: '/', destination: '/inicio', permanent: true },
      { source: '/planos', destination: '/beneficios', permanent: true },
    ];
  },

  typescript: {
    // Mantém o build seguro — falha se houver erro real
    ignoreBuildErrors: false,
  },
  eslint: {
    // Evita falha por ESLint no Amplify
    ignoreDuringBuilds: true,
  },

  images: {
    remotePatterns: [
      { protocol: 'https', hostname: 'placehold.co', pathname: '/**' },
      { protocol: 'https', hostname: 'picsum.photos', pathname: '/**' },
      { protocol: 'https', hostname: 'images.unsplash.com', pathname: '/**' },
      { protocol: 'https', hostname: 'www.omatheusmarques.com.br', pathname: '/**' },
      { protocol: 'https', hostname: 'i.imgur.com', pathname: '/**' },
      { protocol: 'https', hostname: 'i.pravatar.cc', pathname: '/**' },
      { protocol: 'https', hostname: 'imgur.com', pathname: '/**' },
      { protocol: 'https', hostname: 'logopng.com.br', pathname: '/**' },
      // Firebase Storage e Google
      { protocol: 'https', hostname: 'firebasestorage.googleapis.com', pathname: '/**' },
      { protocol: 'https', hostname: 'lh3.googleusercontent.com', pathname: '/**' },
    ],
  },

  allowedDevOrigins: [
    '9000-firebase-treino-indoorbk2309-1758646726020.cluster-mdgxqvvkkbfpqrfigfiuugu5pk.cloudworkstations.dev',
  ],

  webpack: (config, { isServer }) => {
    // ✅ Path alias
    config.resolve.alias = {
      ...config.resolve.alias,
      '@': path.resolve(__dirname, 'src'),
    };

    // ✅ Corrige o erro “Critical dependency: require function...”
    //   causado por @opentelemetry e require-in-the-middle
    if (!isServer) {
      config.resolve.fallback = {
        ...config.resolve.fallback,
        'require-in-the-middle': false,
        fs: false,
        path: false,
        os: false,
        net: false,
        tls: false,
        crypto: false,
        module: false,
      };
    }

    // ✅ Ignora warnings críticos que não afetam runtime
    config.ignoreWarnings = [
      { message: /Critical dependency: require function/ },
      { module: /require-in-the-middle/ },
    ];

    return config;
  },
};

export default nextConfig;
